import { BrandsStateActions } from './../../types/brand';

import { Dispatch } from "redux"
import axios from 'axios';

export const fetchBrands = () => {
    return async (dispatch: Dispatch<BrandsStateActions>) => {
        try {
            const response = await axios.get("http://localhost:3000/public/brands.json")
            console.log(response.data);
        } catch {

        }
    }
}
